"      Stogar (JP)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"list_set htclist drugH1Div drugBrandNames\" id=\"F3902771\" xmlns=\"file://www.w3.org/1999/xhtml\">",
