"    <ul>",
"     <li>",
"      <span class=\"list-set-name\">",
"       Histamine H",
"       <sub>",
"        2",
"       </sub>",
"       Antagonist",
"      </span>",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block iuse drugH1Div\" id=\"F3466548\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Reported Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Treatment of gastric, duodenal, and stomal ulcers; acute gastritis and acute exacerbation of chronic gastritis; preanesthetic",
"    </p>",
"   </div>",
"   <div class=\"block idos drugH1Div\" id=\"F3466550\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Range",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Adults: Oral:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Gastritis (acute) and acute exacerbation of chronic gastritis: 10 mg/day after evening meal or before bedtime",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Preanesthetic: 10 mg prior to bedtime the day before operation and 2 hours before introduction of anesthetic on day of operation",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Ulcers, gastric, duodenal, and stomal: 10 mg twice daily, once after breakfast and once after evening meal or before bedtime",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;margin-top:2em;\">",
"     <b>",
"      Dosage adjustment in the elderly:",
"     </b>",
"     Decrease dose and/or interval according to physiologic function",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     <b>",
"      Dosage adjustment in the renal/hepatic impairment:",
"     </b>",
"     Decreased dose and/or interval may be required",
"    </p>",
"   </div>",
"   <div class=\"block prod-avail drugH1Div\" id=\"F11821099\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Product Availability",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Product available in various countries; not currently available in the U.S.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F3466551\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Tablet: 5 mg, 10 mg",
"    </p>",
"   </div>",
"  </div>",
