"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?30/5/30802?source=see_link\">",
"       Patient information: Epilepsy and pregnancy (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?11/45/11988?source=see_link\">",
