"      </a>",
"      <br/>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?41/47/42739?source=see_link\">",
"       Patient information: Abortion (pregnancy termination) (Beyond the Basics)",
"      </a>",
"     </p>",
"    </div>",
